import Button from "../components/Button/Button";

const Home = () => { 

    let counter = 0

    const count = ()=> {
        console.log(counter)
        counter++
    }

    return (
        <Button onClick={count}>
            <div>{ counter }</div>
        </Button>
    )
}

export default Home;
